import React from 'react';


const AboutmeText = () => {
    return (
        <p className="aboutme--text">I was born and raised in the San Francisco Bay Area.
        I am currently studying Computer Science and Integrative Biology at UC Berkeley.
        Since I can remember technology has been my number one passion.
        When starting out at college, I was more focused on biology, as that is my second passion.
        But once I took my first CS course, I knew this was what I wanted to do for the rest of my life.
        In my spare time, I have recently gotten very into doing side projects.
        Over the summer, I created a full functional chess game in python and even implemented a working AI, although it only goes 3 moves deep.
        Currently, I am building this website as a means to learn the React framework. 
        </p>
    )
}

export default AboutmeText;
